package com.guessinggame.guessinggame.repository;import com.guessinggame.guessinggame.entity.User;import org.springframework.data.jpa.repository.JpaRepository;import org.springframework.data.jpa.repository.Query;import org.springframework.stereotype.Repository;import java.util.List;@Repositorypublic interface UserRepository extends JpaRepository<User, Long> {    @Query(value = "select * from game_user where game_user.played_games >= ?1", nativeQuery = true)    public List<User> findAllByMinPlayedGAndGamesWin(Integer played_games);}